import React from "react";
import useFetch from "../../util/useFetch";


function Todocount () {
    const [todo] = useFetch('http://localhost:3000/lists/')
    const len = todo.length

    return (
        <div>
            <div>
                오늘 해야할 일 : {len}개
            </div>
            <div>
                오늘 한 일 : {len}개
            </div>
        </div>
    )
}

export default Todocount
